import axios from 'axios'
export const productList= ({success, error})=>{
    axios.get(`http://${this.$ipAdres}:8007/seller/product/all`)
         .then((response)=>{
            console.log("productlist request success");
            success && success(response);
         })
         .catch((err)=>{
            error && error(err);
         })
}
